import { Main, Button, Heading, Box, Paragraph } from 'grommet';
import { Inspect } from 'grommet-icons';

class Sample extends React.Component{
    constructor(props) {
        super(props);

        this.state = {
        };
    }

    render(){

        const Component =         
        <Box 
            justify="center" 
            align="center" 
            pad="medium"
            height="medium"   
        >
            <Main>
            <Heading
                    alignSelf = "center"
                    color = "white">
                Welcome to Eusoff Virtual Tour
            </Heading>
            <Paragraph
                    alignSelf = "center"
                    color = "white"
                    pad = "medium"
                >
                    Welcome to Eusoff Hall virtual tour! Scroll down to start exploring
            </Paragraph>
            </Main>
        </Box>

        return (Component)
    }
}

export default Sample;
